import {Switch} from '@material-ui/core';
import MenuTwoToneIcon from '@material-ui/icons/MenuTwoTone';

const Nav = ({setDarkMode, darkMode}) => {
    return(
        <div className="p-1 flex w-screen 
                      dark:bg-slate-900 
                      dark:text-white 
                        justify-between
                        align-center">
            <MenuTwoToneIcon />
            <h1 className="rotate-3 p-1 rounded border-2 text-5xl text-center lg:text-3xl text-slate-900 dark:text-slate-50">
                S<span>K</span>ILLET
                </h1>
            <Switch 
                className="dark:bg-slate-900"
                color="primary"
                onChange={() => setDarkMode(!darkMode)}
            />
        </div>
    )
}

export default Nav;
